import axios from "axios";
import authHeader from "./auth-header";

const API_URL = "http://localhost:8080/api/schedule/";

class ScheduleService {
  getSchedule(filters) {
    console.log(filters);
    return axios.post(API_URL + "get", {
      filters,
    });
  }
}

export default new ScheduleService();
